import styled from "styled-components";
import { testBorder } from "../../styles/sharedStyles";

////////////////* CONTAINERS ////////////////////////

export const MainContainer = styled.div`
  margin: 0;
  padding: 0;
  width: 100vw;
  height: 100vh;

  display: flex;
  justify-content: center;
  align-items: center;

  ${testBorder}
`;

export const DashboardContainer = styled.div`
  width: 80%;
  height: 900px;
  min-width: 800px;

  margin: 5rem 0;


  ${testBorder};
`

